window.bookSummaryJSON = "<p>Ken returns from the Elven World to another year at Haylon College.<br> Yet, attitudes towards training have changed, the Naga attack has shifted priorities</p> <p>the world over and Ken finds himself and his fellow classmates pushed harder than ever before.</p> <p>The big four colleges no longer are going to focus on survival of their students, it's time to push them and let the strongest shine.</p> <p>Which would be okay for Ken, if a new problem hadn't cropped up. A monster that doesn't appear in any of the records has been stalking him through the dungeon. The answer to it, might actually lie in Crimson's past.</p>"; 
